import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../services/AuthContext';
import '../styles/Navbar.css';

export default function Navbar() {
  const navigate = useNavigate();
  const { isAuthenticated, user, logout } = useAuth();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="navbar-brand">
          <h1 onClick={() => navigate('/')}>RestaurantHub</h1>
        </div>
        <ul className="navbar-menu">
          {isAuthenticated ? (
            <>
              <li><a onClick={() => navigate('/restaurants')}>Restaurants</a></li>
              <li><a onClick={() => navigate('/bookings')}>My Bookings</a></li>
              <li><a onClick={() => navigate('/orders')}>My Orders</a></li>
              <li className="user-info">{user?.name}</li>
              <li><button onClick={handleLogout} className="btn btn-logout">Logout</button></li>
            </>
          ) : (
            <>
              <li><a onClick={() => navigate('/login')}>Login</a></li>
              <li><a onClick={() => navigate('/register')}>Register</a></li>
            </>
          )}
        </ul>
      </div>
    </nav>
  );
}
